            WriteLiteral(@"    <article>
        <h2>4.1 Front-end</h2>
        <p>Cez formulár sa nahraje na server súbor obrázku a uloží sa do dočasnej zložky. Užívateľ je presmerovaný späť na stránku, kde mu je zobrazený uložený obrázok aby sa mu vizuálne potvrdilo úspešný nahravanie +  je aktivované tlačidlo pre sťahovanie. Užívateľ zadá do tabuľky zo vstupmi požadované hodnoty a stlačí tlačidlo sťahovania. To spustí funkciu ktorá extrahuje hodnoty z tabuľky a spolu z názvom súboru ich cez AJAX odošle na API servera. Späť sa vráti odkaz na súbor, takže ak je akcia úspešná, otvorí nové okno prehliadača z odkazom, čo vyvolá sťahovanie súboru. </p>
        <br />
        <h2>4.2 Back-end</h2>
        <p>Obrázok je uložený na server aby nemusel nahrávať pri každej zmene šírky. Po zavolaní na API sa vygeneruje unikátny kľuč ktorým sa pomenuje zložka a ZIP súbor, aby sa zamedzilo náhodnému prepisovaniu súborov na servery. Následne je v cykle volaná metóda pre konvert a uloženie obrázku, pre každú šírku z poľa. Všetky upravené obrázk");
            WriteLiteral(@"y sú uložené do zložky a na tú je zavolaná metóda pre vytvorenie ZIP súboru, ktorý je následne uložený vedľa tejto zložky. Ak všetko prebehlo úspešne, zloží sa adresa k tomu súboru a tá je vrátená. Adresu si odchytí AJAX a spustí sťahovanie. </p>
    </article>
</div>
